miscConds.notes:
Defendant shall pay supervisory fees to the Department of Corrections;
Defendant shall complete any/all counseling, evaluations, assessments, and follow-up as deemed appropriate;
Defendant shall not possess/consume any alcohol, controlled substances or drug paraphernalia;
Submit DNA sample.
Defendant shall enroll in in-patient treatment for drug addiction within 30 days from sentence date.  Proof to be provided to the court. Defendant may request an extension if necessary with proof.  When defendant is not in treatment, defendant shall maintain full time employment.  Should defendant become unemployed he shall apply at 20 businesses/month that are hiring and file work search affidavits.
If defendant violates order to enroll in in-patient treatment within specified time, court may impose jail time.
Defendant shall submit to random urinalysis.
